const projects = [
  {
    title: "MERN eCommerce",
    image: "./images/coinbase.png",
    description:
      "Full featured ecommerce store built with MERN stack and Paypal payments API. Admin page to manage customers, products & orders.",
    tools: ["React", "Redux", "MongoDB", "JWT", "Express"],
    github: "https://github.com/Deelip7/react-node-ecommerce",
    link: "https://rn-store.herokuapp.com/",
  },
  {
    title: "Movie App",
    image: "./images/twitterClone.png",
    description:
      "Discover the most popular, top rated and latest movies. Users can also find a movie based on the movie title.",
    tools: ["React", "API", "SASS"],
    github: "https://github.com/Deelip7/react-tmdb-app",
    link: "https://festive-wilson-a51c32.netlify.app/",
  },
];

export default projects;
